$dateiPfad_3100_02 = &quot;$ordnerPfad\Agenttest_Filetransfer_02_Quelle_3100.txt&quot;
$dateiPfad_3200_1_02 = &quot;$ordnerPfad\Agenttest_Filetransfer_02_Quelle_3200_1.txt&quot;
$dateiPfad_3200_2_02 = &quot;$ordnerPfad\Agenttest_Filetransfer_02_Quelle_3200_2.txt&quot;
