$dateiPfad_3500_02 = &quot;$ordnerPfad\Agenttest_Filetransfer_02_Quelle_3500.txt&quot;
$dateiPfad_3600_02 = &quot;$ordnerPfad\Agenttest_Filetransfer_02_Quelle_3600.txt&quot;


# Text zum Schreiben
$text = &quot;Dies ist ein Testtext f&#252;r den Agententest. &quot; * 50 

# Ordner erstellen, falls er noch nicht existiert
if (!(Test-Path -Path $ordnerPfad)) {
    New-Item -ItemType Directory -Path $ordnerPfad
}

# Datei erstellen
New-Item -ItemType File -Path $dateiPfad_3100_02
New-Item -ItemType File -Path $dateiPfad_3200_1_02
