New-Item -ItemType File -Path $dateiPfad_3300_02
New-Item -ItemType File -Path $dateiPfad_3400_02
New-Item -ItemType File -Path $dateiPfad_3500_02
New-Item -ItemType File -Path $dateiPfad_3600_02


# Text in die Datei schreiben
Set-Content -Path $dateiPfad_3100_02 -Value $text
